<!DOCTYPE html>
<html lang="ar">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>صفحتي الرئيسية</title>
    <style>
        /* تنسيق عام للصفحة */
        body {
            font-family: system-ui;
            background-color: white;
            color: black;
            text-align: center;
            margin: 0;
            padding: 0;
        }

        /* تنسيق النص في الأطراف */
        .header {
            background-color: white;
            color: #000080;
            text-align: center;
            padding: 10px;
            position: fixed;
            top: 0;
            width: 100%;
            z-index: 1; /* للتأكد من ظهور النصوص فوق العناصر الأخرى */
            display: flex;
            flex-direction: column; /* لجعل النصوص تظهر بشكل عمودي */
            gap: 5px; /* المسافة بين النصوص */
        }

        /* تنسيق الحقل والصورة */
        .container {
            position: relative;
            text-align: center;
            margin-top: 100px; /* زيادة الهامش لتجنب التداخل مع النصوص العلوية */
            padding: 20px;
        }

        img {
            max-width: 100%; /* لجعل الصورة متجاوبة */
            height: auto;
        }

        .search-box {
            position: absolute;
            top: 99%; /* تم تغيير هذه القيمة لتحريك البحث للأسفل */
            left: 50%;
            transform: translate(-50%, -50%);
            background-color: rgba(255, 255, 255, 0.8);
            padding: 10px;
            border-radius: 5px;
            width: 90%; /* لجعلها متجاوبة مع الشاشات الصغيرة */
            max-width: 400px; /* تحديد أقصى عرض */
        }

        input[type="text"] {
            padding: 10px;
            width: calc(100% - 20px); /* لجعل الحقل متجاوبًا */
            margin-bottom: 10px;
            border: 1px solid #ccc;
            border-radius: 5px;
        }

        button {
            padding: 10px 20px;
            background-color: #f06d06;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            width: 100%; /* لجعل الزر متجاوبًا */
        }

        button:hover {
            background-color: #d45a05;
        }

        /* تحسينات للجوال */
        @media (max-width: 600px) {
            .search-box {
                top: 50%; /* تعديل الموضع للجوال */
                width: 80%; /* تقليل العرض على الشاشات الصغيرة */
            }

            .header {
                font-size: 14px; /* تصغير حجم الخط للجوال */
            }
        }
    </style>
</head>

        function searchWebsite() {
            const searchInput = document.getElementById("searchInput").value.trim().toLowerCase();
            const resultsContainer = document.getElementById("resultsContainer");

            resultsContainer.innerHTML = "";

            const websiteURL = websites[searchInput];

            if (websiteURL) {
                const linkElement = document.createElement("a");
                linkElement.href = websiteURL;
                linkElement.textContent = "انقر هنا للانتقال إلى الموقع";
                linkElement.target = "_blank"; // لفتح الرابط في نافذة جديدة
                resultsContainer.appendChild(linkElement);
            } else {
                resultsContainer.textContent = "لم يتم العثور على الموقع المطلوب.";
            }
        }
    </script>
